import PersonalPage from "./page/personelPage";
import Dashboard from "./page/Dashboard";
import EnvanterPage from "./page/envanterPage";
const routes = [
  { path: "/", name: "Anasayfa", component: Dashboard },
  { path: "/personel-page", name: "Personel Listesi", component: PersonalPage },
  { path: "/envanter-page", name: "Envanter Listesi", component: EnvanterPage },
];

export default routes;
